import { LinkIcon, PlusIcon } from "@heroicons/react/outline";

import {Link} from 'react-router-dom';
import Posts from "./Posts.jsx";
import CreatediaryModal from "../Modals/CreatediaryModal.jsx";
import { useState } from 'react';
import OutsideClickHandler from 'react-outside-click-handler';

function Feed(diaryId, setDiaryId) {

    const[popCreatediary, setpopCreatediary] = useState(false);

    return (

    <div className="overflow-y-scroll">

        {/*==============SIGN UP =================*/}

                <div className="fixed text-gray-700 font-bold top-28 left-0 w-full flex justify-center z-40">

                {/* ============Floating Box======== */}
                    <div className="bg-white rounded-md shadow-xl">

                        <div className="text-center p-4 bg-transparent">
                            <p>Create New Account</p>
                        </div>


                        {/*========= Inputs=============== */}
                        <div className="p-4 text-sm ">
                       {/* First and LastNames */}

                        <div className= "p-1 flex items-center justify-around">
                            <input className= "w-full bg-white border border-gray-300 m-1 p-2 rounded-md" type="text" placeholder= "First Name"/>
                            <input className= "w-full bg-white border border-gray-300 m-1 p-2 rounded-md" type="text" placeholder= "Last Name"/>
                        </div>

                       {/* UserName */}
                       <div className= "p-1 flex items-center justify-around">
                            <input className= "w-full bg-white border border-gray-300 m-1 p-2 rounded-md" type="text" placeholder= "Username"/>
                        </div>
                          {/* Email*/}
                       <div className= "p-1 flex items-center justify-around">
                            <input className= "w-full bg-white border border-gray-300 m-1 p-2 rounded-md" type="text" placeholder= "Email"/>
                        </div>
                          {/* Password*/}
                       <div className= "p-1 flex items-center justify-around">
                            <input className= "w-full bg-white border border-gray-300 m-1 p-2 rounded-md" type="text" placeholder= "Password"/>
                        </div>
                             {/* Confirm Password*/}
                       <div className= "p-1 flex items-center justify-around">
                            <input className= "w-full bg-white border border-gray-300 m-1 p-2 rounded-md" type="text" placeholder= "Confirm Password"/>
                        </div>
                        </div>






                    </div>

                </div>

                <div className="flex justify-center">
                {/* Button */}  
                    {/* <OutsideClickHandler onOutsideClick={() => {setpopCreatediary(false);}}>

                            <div className="bg-gradient-to-r bg-gray-700 hover:from-pink-500 hover:to-yellow-500 flex justify-around mx-4 mt-2 sm:mt-4 py-2 text-sm px-5 items-center cursor-pointer  font-bold rounded-full shadow-xl"
                                onClick={ () => {setpopCreatediary(!popCreatediary)}}>
                                <LinkIcon className="p-0.5 h-6 text-white"/>
                                <p className="text-white">Attach Post</p>
                            </div>
                            <div className="flex bg-red-300 justify-center">
                                {popCreatediary && <CreatediaryModal diaryId ={diaryId} setDiaryId ={setDiaryId}/>}
                            </div>
                    </OutsideClickHandler> */}



                            <Link to ='/PostForm'>
                                <div className="bg-gradient-to-r bg-gray-700 
                                hover:from-pink-500 hover:to-yellow-500 
                                flex justify-around mx-4 mt-2 
                                sm:mt-4 py-2 text-sm px-5 
                                items-center cursor-pointer 
                                font-bold rounded-full shadow-xl"
                              // onClick={ () => {setpopCreatediary(!popCreatediary)}}
                                    >
                                    <LinkIcon className="p-0.5 h-6 text-white"/>
                                    <p className="text-white">Attach Post</p>
                                </div>
                            </Link>



                </div>



       <Posts diaryId={diaryId} setDiaryId={setDiaryId}/>


    </div>
    )
}

export default Feed;
